import React from 'react'

class User extends React.Component {
	constructor() {
		super();
	}

	render() {
		return <tr key={props.index}>
                    <td>{props.name}</td>
                    <td>{props.surname}</td>
                    <td><input onChange={props.changeSalary.bind(this, index)} value={props.salary} style={{width: "30px"}} type="text" /></td>
                    <td><input onChange={props.changeDays.bind(this, index)} value={props.days} style={{width: "30px"}} type="text" /></td>
                    <td>{props.salary * props.days}</td>
                </tr>
    }
}

export default User;
